import React from "react";
import Container from "@mui/material/Container";
import Input from "@mui/joy/Input";
import Grid from "@mui/joy/Grid";
import Typography from "@mui/material/Typography";
import Button from "@mui/joy/Button";
import { useNavigate, redirect, Form } from "react-router-dom";
import Divider from "@mui/material/Divider";
import TextField from "@mui/material/TextField";
import List from "@mui/material/List";
import ListItem from "@mui/material/ListItem";
import HomeIcon from "@mui/icons-material/Home";
import ShareIcon from "@mui/icons-material/Share";
import ModeIcon from "@mui/icons-material/Mode";
import ClearIcon from "@mui/icons-material/Clear";
import PersonIcon from "@mui/icons-material/Person";
import ButtonBase from "@mui/material/ButtonBase";
import axios from "axios";
import { useCookies } from "react-cookie";
//axios.defaults.withCredentials = true;

async function tryLogin() {
  axios
    .post("http://localhost:3002/login", {
      username: "username",
      password: "password",
    })
    .then((response) => {
      console.log(response);
    })
    .catch((error) => {
      console.log(error);
    });
}

async function creaAppartamento() {
  try {
    const response = await axios.post("http://localhost:3002/apartments", {
      name: "appartamento",
      description: "descrizione",
      admin: "username",
      users: ["username"],
      expanses: [],
    });
    console.log(response);
    return response; // Ritorna la risposta dalla chiamata axios
  } catch (error) {
    console.error(error);
    throw error; // Lanciamo l'errore per gestirlo nell'evento onClick
  }
}

export default function Appartamenti() {
  const navigate = useNavigate();

  const [apartments, setApartmenst] = React.useState(null);

  React.useEffect(() => {
    axios
      .get("http://localhost:3002/apartments")
      .then((response) => {
        console.log(response);
        setApartmenst(response.data);
      })
      .catch((error) => {
        console.log(error);
      });
  }, []);
  console.log(apartments);

  return (
    <div
      style={{
        width: "100%",
        height: "100%",
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
      }}
    >
      <Container
        style={{
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
          height: "100vh",
          width: "100vw",
        }}
      >
